import React, { useState } from "react";
import axios from "axios";

const DataComponent = () => {
  const [uai, setUai] = useState("");
  const [granularity, setGranularity] = useState("");
  const [tableData, setTableData] = useState([]);
  const [error, setError] = useState(null);

  const handleTableSubmit = (e) => {
    e.preventDefault();

    axios
      .get(
        `https://data.education.gouv.fr/api/records/1.0/search/?dataset=fr-en-dnma-par-uai-appareils&q=&facet=debutsemaine${granularity}&facet=uai&refine.uai=${uai}`
      )
      .then((response) => {
        const records = response.data.records;
        const data = processDataForTable(records);
        setTableData(data);
        setError(null);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setTableData([]);
        setError("Error fetching data. Please try again.");
      });
  };

  const months = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
    "Dec",
  ];
  
  const processDataForTable = (records, granularity) => {
    let aggregatedData = [];
  
    if (granularity === "mois") {
      aggregatedData = records.reduce((acc, record) => {
        const monthIndex = new Date(record.fields.debutsemaine).getMonth();
        const monthLabel = months[monthIndex];
        if (!acc[monthLabel]) {
          acc[monthLabel] = {
            tablet: 0,
            smartphone: 0,
            computer: 0,
          };
        }
        acc[monthLabel].tablet += record.fields.visites_tablette || 0;
        acc[monthLabel].smartphone += record.fields.visites_smartphone || 0;
        acc[monthLabel].computer += record.fields.visites_ordinateur || 0;
        return acc;
      }, {});
    } else if (granularity === "semaine") {
      aggregatedData = records.reduce((acc, record) => {
        const weekLabel = record.fields.debutsemaine;
        if (!acc[weekLabel]) {
          acc[weekLabel] = {
            tablet: 0,
            smartphone: 0,
            computer: 0,
          };
        }
        acc[weekLabel].tablet += record.fields.visites_tablette || 0;
        acc[weekLabel].smartphone += record.fields.visites_smartphone || 0;
        acc[weekLabel].computer += record.fields.visites_ordinateur || 0;
        return acc;
      }, {});
    } else if (granularity === "annee") {
      aggregatedData = records.reduce((acc, record) => {
        const yearLabel = new Date(record.fields.debutsemaine).getFullYear().toString();
        if (!acc[yearLabel]) {
          acc[yearLabel] = {
            tablet: 0,
            smartphone: 0,
            computer: 0,
          };
        }
        acc[yearLabel].tablet += record.fields.visites_tablette || 0;
        acc[yearLabel].smartphone += record.fields.visites_smartphone || 0;
        acc[yearLabel].computer += record.fields.visites_ordinateur || 0;
        return acc;
      }, {});
    }
  
    return aggregatedData;
  };
  

  return (
    <div>
      <form onSubmit={handleTableSubmit}>
        <label>
          UAI:
          <input
            type="text"
            value={uai}
            onChange={(e) => setUai(e.target.value)}
          />
        </label>
        <br />
        <label>
          Granularity:
          <select
            value={granularity}
            onChange={(e) => setGranularity(e.target.value)}
          >
            <option value="">Select Granularity</option>
            <option value="Année">Année</option>
            <option value="Mois">Mois</option>
            <option value="Semaine">Semaine</option>
          </select>
        </label>
        <br />
        <button type="submit">Generate Table</button>
      </form>

      {tableData.length > 0 ? (
        <div>
          <h2>Visits Table</h2>
          <table>
            <thead>
              <tr>
                <th>Week</th>
                <th>Tablet Visits</th>
                <th>Smartphone Visits</th>
                <th>Computer Visits</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((dataRow, index) => (
                <tr key={index}>
                  <td>{dataRow.Week}</td>
                  <td>{dataRow.TabletVisits}</td>
                  <td>{dataRow.SmartphoneVisits}</td>
                  <td>{dataRow.ComputerVisits}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p>{error}</p>
      )}
    </div>
  );
};

export default DataComponent;
